import '.././style/App.css';

function Movies() {
  useEffect( () => {
    fetchItems();
  }, []);

  const [items, setItems] = useState([]);

  const fetchItems = async () => {
    const data = await fetch (
      '.././feed/sample.json'
    );

    const items = await data.json();
    console.log(items.items);
    setItems(items.items);
  }


    return(
      <div>
